DROP DATABASE IF EXISTS `Ascomycota_members`;
CREATE DATABASE `Ascomycota_members`; 
USE `Ascomycota_members`;

SET NAMES utf8 ;
SET character_set_client = utf8mb4;

CREATE TABLE `members` (
  `member_id` int(227) NOT NULL,
  `unique_id` varchar(10) NOT NULL,
  `mycocosm_name` varchar(100) NOT NULL,
  `unique_name` varchar(100) NOT NULL,
  `family` varchar(50) NOT NULL,
  `order` varchar(50) NOT NULL, 
  `Complete(%)` decimal(9,2) NOT NULL,
  `Single_copy(%)` decimal(9,2) NOT NULL,
  `Duplicated(%)` decimal(9,2) NOT NULL,
  `Fragmented(%)` decimal(9,2) NOT NULL,
  `Missing(%)` decimal(9,2) NOT NULL,
  `Total_BUSCO_groups_searched` int(4) NOT NULL,
  PRIMARY KEY (`member_id`)
) ENGINE=InnoDB AUTO_INCREMENT=226 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
